Screenshot of tweet thread:

@just_manchild: “While states *do* have the right to pass gun restrictions, they're still bound by your 2A exactly the same as how they have to abide by 1A. This case is about fleshing out the limits of what restrictions the constitution allows, now that 2A has been incorporated against states.”

@Jambilove: “No they aren’t. And no they don’t. The bill of rights restricts the general government. Period. States have their own Constitutions and Bill of Rights and they absolutely can amend and restrict free speech. The incorporation of BOR is not legitimate and destroys federalism.”

